import React,{ useState } from 'react';
import User from './User';

function App() {

  let [no, setno] = useState(5)

  let show=()=>{
    setno(no = no+1)
  }

  return (
    <>
      <h2>App Component</h2>
      <button onClick={show}>Increment</button>
      <hr/>
      <User uno={no}/>
    </>
  );
}

export default App;
